#include <bits/stdc++.h>
using namespace std;

typedef pair<int, int> pii;

const int MAX = 2e5 + 15;
const int INF = 0x3f3f3f3f;

int n, m, q, s;
int dist[MAX], source[MAX]; 
int pai[MAX], sze[MAX];
bool resp[MAX];

vector<pair<int, int>> adj[MAX];
vector<tuple<int, int, int>> edges;

int find(int u){
	return pai[u] = (pai[u] == u ? u : find(pai[u]));
}

void join(int u, int v){
	u = find(u), v = find(v);
	if(u == v) return;

	if(sze[u] < sze[v]) swap(u, v);
	sze[u] += sze[v]; pai[v] = u;
}

void dijkstra(vector<int>& sources){
	for(int i = 1; i <= n; i++)
		dist[i] = INF, source[i] = -1;

	priority_queue<pii, vector<pii>, greater<pii>> q;

	for(auto t : sources)
	{
		dist[t] = 0; source[t] = t;
		q.push({ 0, t });
	}

	vector<bool> seen(n + 1);

	while(q.size()){
		auto [d, u] = q.top(); q.pop();
		if(seen[u]) continue;

		seen[u] = true;

		for(auto [v, w] : adj[u]){
			if(dist[v] > d + w){
				dist[v] = d + w;
				source[v] = source[u];

				q.push({ dist[v], v });
			}
		}
	}
}

int32_t main(void)
{
	ios_base::sync_with_stdio(false);
	cin.tie(NULL);

	cin >> n >> s >> m;

	vector<int> sources(s);
	for(auto &x : sources) cin >> x;

	while(m--){
		int u, v, w; cin >> u >> v >> w;

		adj[u].emplace_back(v, w);
		adj[v].emplace_back(u, w);

		edges.emplace_back(w, u, v);
	}

	dijkstra(sources);

	vector<tuple<int, int, int, int, int>> sweep;

	for(auto [w, u, v] : edges){
		int curW = dist[u] + dist[v] + w;
		sweep.emplace_back(curW, 0, source[u], source[v], -1);
	}

	cin >> q;

	for(int i = 1; i <= q; i++){
		int u, v, w; cin >> u >> v >> w;
		sweep.emplace_back(w, 1, u, v, i);
	}

	iota(pai + 1, pai + 1 + n, 1);
	fill(sze + 1, sze + 1 + n, 1);
	sort(sweep.begin(), sweep.end());

	for(auto [w, type, u, v, id] : sweep){
		if(type == 0) join(u, v);
		else resp[id] = (find(u) == find(v));
	}

	for(int i = 1; i <= q; i++)
		cout << (resp[i] ? "TAK" : "NIE") << '\n';
}

