const char *
os_get_option(const char *name)
{
   const char *opt = getenv(name);
   return opt;
}

char *
loader_get_driver_for_fd(int fd)
{
   char *driver = NULL;

   /* Allow an environment variable to force choosing a different driver
    * binary.  If that driver binary can't survive on this FD, that's the
    * user's problem, but this allows vc4 simulator to run on an i965 host,
    * and may be useful for some touch testing of i915 on an i965 host.
    */
   if (geteuid() == getuid()) {
      const char *override = os_get_option("MESA_LOADER_DRIVER_OVERRIDE");
      if (override)
         return strdup(override);
   }

#if 0
#if defined(USE_DRICONF)
   driver = loader_get_dri_config_driver(fd);
   if (driver)
      return driver;
#endif

   driver = loader_get_pci_driver(fd);
   if (!driver)
      driver = loader_get_kernel_driver_name(fd);
#else
    (void)fd;
#endif
   return driver;
}

int
loader_open_device(const char *device_name)
{
   int fd;
#ifdef O_CLOEXEC
   fd = open(device_name, O_RDWR | O_CLOEXEC);
   if (fd == -1 && errno == EINVAL)
#endif
   {
      fd = open(device_name, O_RDWR);
      if (fd != -1)
         fcntl(fd, F_SETFD, fcntl(fd, F_GETFD) | FD_CLOEXEC);
   }
   if (fd == -1 && errno == EACCES) {
      printf("failed to open %s: %s\n",
           device_name, strerror(errno));
   }
   return fd;
}

static char *loader_get_kernel_driver_name(int fd)
{
   char *driver;
   drmVersionPtr version = drmGetVersion(fd);

   if (!version) {
      printf("failed to get driver name for fd %d\n", fd);
      return NULL;
   }

   driver = strndup(version->name, version->name_len);
   printf("using driver %s for %d\n", driver, fd);

   drmFreeVersion(version);
   return driver;
}


int main(int argc, char ** argv)
{
	(void)argc;
	(void)argv;
	const char deviceName[] = "/dev/dri/card0";
	int fd = loader_open_device(deviceName);
	char * loader_driverName = loader_get_driver_for_fd(fd);
	if (!loader_driverName) {
		return 1;
	}
	printf("%s\n", loader_driverName);
	char * name = loader_get_kernel_driver_name(fd);
	printf("%s\n", name);
	free(loader_driverName);
	return 0;
}

template <typename... Ts>
struct caller
{
    caller(const Ts&... args) : _a(args...) {}

    void operator()() {
        print(_a);
    }

protected:
    std::tuple<Ts...> _a;

    template <size_t i = 0>
    void print(const std::tuple<Ts...>& args)
    {
        if constexpr (i < sizeof...(Ts))
        {
            std::cout << std::get<i>(args) << " ";
            print<i + 1>(args);
        }
    }
};

int main()
{
    caller<float, std::string> f(0.12f, "Hello");
    f();
}
